import React from 'react';
import { render } from 'react-dom';
import './Contacts.scss';

export class Contacts extends React.Component
{
    constructor(props)
    {
        super(props);        
    }

    handleClick = (item) => {    console.log('this is:', item.description);  }
    
    render()
    {   
        const contactElements = this.props.contacts.map((c, i) => <button onClick={this.handleClick(c)}><li key={i}>{c.title} </li></button>);
        return ( <div className="todoList">Contacts
            <ul>{contactElements}</ul>
        </div>);
    }
}
